import React from 'react';
import Modal from '../modal'

const StreamDelete = () => {
    return (
        <div>
            <Modal 
                header="Delete a Stream" 
                content="Are you sure you want to delete this stream?"
                button1="Delete"
                button2="Cancel"
            />
        </div>
    );
};

export default StreamDelete;
